import * as axios from "axios";

const instance = axios.create({
    withCredentials: true,
    baseURL: 'http://localhost:3000/data.json',
    header: {}
})

export const gameStateAPI = {
    getGameState() {
        return instance.get().then(response => {
            return console.log(response.data.state.gameInProgress);
        });
    }
}
